import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './Navbar.scss';
import { Link } from 'react-router-dom';

const MainNavbar = React.createClass({
  getInitialState () {
    return {
      hamburgerClicked: false
    }
  },
  handlehamburgerClicked () {
    this.setState({
      hamburgerClicked: !this.state.hamburgerClicked
    });
  },
  render () {
    const { hamburgerClicked } = this.state;
    const menuClass = hamburgerClicked ? 'nav-right nav-menu is-active' :'nav-right nav-menu'; 
    return (
      <nav className="nav">
        <div className="nav-left">
          <a className="nav-item">
            <h1 className="title is-4">NavBar</h1>
          </a>
        </div>

        <div className="nav-center">
          <a className="nav-item">
            <span className="icon">
              <i className="fa fa-github"></i>
            </span>
          </a>
          <a className="nav-item">
            <span className="icon">
               <i className="fa fa-twitter"></i>
            </span>
          </a>
        </div>

        <span className={`nav-toggle ${hamburgerClicked ? 'is-active' : ''}`} onClick={this.handlehamburgerClicked}>
          <span></span>
          <span></span>
          <span></span>
        </span>

        <div className={`nav-right nav-menu ${hamburgerClicked ? 'is-active' : ''}`}>
          <a className="nav-item">
            Home
          </a>
          <a className="nav-item">
            Documentation
          </a>
          <a className="nav-item">
            Blog
          </a>

          <span className="nav-item">
            <a className="button" >
              <span className="icon">
                <i className="fa fa-twitter"></i>
              </span>
              <span>Tweet</span>
            </a>
            <a className="button is-primary">
              <span className="icon">
               <i className="fa fa-download"></i>
              </span>
              <span>Download</span>
            </a>
          </span>
        </div>
      </nav>
    );
  }
});

ReactDOM.render(<MainNavbar />, document.getElementById('navbar'));

export default MainNavbar;
